import React from "react";
import "./Sidebar.css";
import _ from "lodash"; // used to convert object to arrays

const Sidebar = props => {
  console.log(_.values(props.contacts));
  return <aside className="Sidebar">Sidebar</aside>;
};

export default Sidebar;
